  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pid` int(11) NOT NULL,
  `parent_path` varchar(255) NOT NULL,
  `name` varchar(255) NOT NULL,
  `sort` int(11) NOT NULL COMMENT '序号越小，越靠前',
  `image` varchar(255) NOT NULL COMMENT '分类图片',
  `create_time` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='文章分类';

-- ----------------------------
-- Records of news_type
-- ----------------------------

-- ----------------------------
-- Table structure for orders
-- ----------------------------
DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(50) NOT NULL COMMENT '订单号',
  `relation_order_sn` varchar(255) NOT NULL COMMENT '关联订单编号',
  `order_type` tinyint(3) NOT NULL COMMENT '订单类型：1、普通订单，2、限时抢购订单',
  `seller_id` int(11) NOT NULL COMMENT '商家ID',
  `member_id` int(11) NOT NULL COMMENT '会员ID',
  `member_name` varchar(100) NOT NULL COMMENT '会员name',
  `order_state` tinyint(3) NOT NULL COMMENT '订单状态：1、未付款的订单；2、待确认的订单；3、待发货的订单；4、已发货的订单；5、已完成的订单；6、取消的订单',
  `pay_time` datetime DEFAULT NULL COMMENT '付款时间',
  `payment_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '付款状态：0 买家未付款 1 买家已付款',
  `invoice_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '发票状态0、不要发票；1、单位；2个人',
  `invoice_title` varchar(255) DEFAULT '' COMMENT '发票抬头',
  `invoice_type` varchar(50) DEFAULT '' COMMENT '发票类型（内容）',
  `money_product` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品金额，等于订单中所有的商品的单价乘以数量之和',
  `money_logistics` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '物流费用',
  `money_order` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单总金额，等于商品总金额＋运费-优惠金额总额',
  `money_paid_balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '余额账户支付总金额',
  `money_paid_reality` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现金支付金额',
  `money_coupon` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '优惠券优惠金额',
  `money_act_full` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单满减金额',
  `money_discount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '优惠金额总额（满减、立减、优惠券等所有优惠额的和）',
  `money_back` decimal(10,2) NOT NULL COMMENT '退款的金额，订单没有退款则为0',
  `money_integral` decimal(10,2) NOT NULL COMMENT '积分换算金额',
  `integral` int(11) NOT NULL COMMENT '订单使用的积分数量',
  `coupon_user_id` int(11) NOT NULL COMMENT '优惠码ID',
  `act_full_id` int(11) NOT NULL COMMENT '订单满减活动ID',
  `ip` varchar(50) NOT NULL COMMENT 'ip',
  `payment_name` varchar(100) NOT NULL COMMENT '支付方式名称',
  `payment_code` varchar(100) NOT NULL COMMENT '支付方式code',
  `name` varchar(60) NOT NULL COMMENT '收货人',
  `province_id` int(11) NOT NULL COMMENT 'Province',
  `city_id` int(11) NOT NULL COMMENT 'city',
  `area_id` int(11) NOT NULL COMMENT 'area',
  `address_all` varchar(255) NOT NULL COMMENT '省市区组合',
  `address_info` varchar(255) NOT NULL COMMENT '详细地址',
  `mobile` varchar(50) NOT NULL DEFAULT '',
  `email` varchar(255) NOT NULL DEFAULT '',
  `zip_code` varchar(20) NOT NULL COMMENT '邮编',
  `remark` varchar(255) NOT NULL COMMENT '订单备注',
  `deliver_time` datetime DEFAULT NULL COMMENT '发货时间',
  `finish_time` datetime DEFAULT NULL COMMENT '订单完成时间',
  `trade_sn` varchar(100) NOT NULL COMMENT '在线支付交易流水号',
  `source` tinyint(4) NOT NULL COMMENT '会员来源1、pc；2、H5；3、Android；4、IOS',
  `logistics_id` int(11) NOT NULL COMMENT '物流公司ID',
  `logistics_name` varchar(100) NOT NULL COMMENT '物流公司',
  `logistics_number` varchar(100) NOT NULL COMMENT '发票快递单号',
  `is_codconfim` tinyint(4) NOT NULL COMMENT '是否货到付款订单0、不是；1、是',
  `codconfirm_id` int(11) NOT NULL COMMENT '货到付款确认人',
  `codconfirm_name` varchar(100) NOT NULL COMMENT '货到付款确认Name',
  `codconfirm_time` datetime DEFAULT NULL COMMENT '货到付款确认时间',
  `codconfirm_remark` varchar(255) NOT NULL COMMENT '货到付款确认备注',
  `codconfirm_state` tinyint(3) NOT NULL COMMENT '货到付款状态 0、非货到付款；1、待确认；2、确认通过可以发货；3、订单取消',
  `create_time` datetime NOT NULL,
  `update_time` datetime NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `orderSn` (`order_sn`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 COMMENT='订单';

-- ----------------------------
-- Records of orders
-- ----------------------------

-- ----------------------------
-- Table structure for orders_product
-- ----------------------------
DROP TABLE IF EXISTS `orders_product`;
CREATE TABLE `orders_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `orders_id` int(11) NOT NULL COMMENT '订单ID',
  `orders_sn` varchar(100) NOT NULL COMMENT '订单号',
  `seller_id` int(11) NOT NULL COMMENT '商家ID',
  `product_cate_id` int(11) DEFAULT NULL COMMENT '商品分类ID',
  `product_id` int(11) NOT NULL COMMENT '商品id',
  `product_goods_id` int(11) NOT NULL COMMENT '货品ID',
  `spec_info` varchar(255) DEFAULT NULL COMMENT '规格详情',
  `product_name` varchar(255) NOT NULL COMMENT '商品名称',
  `product_sku` varchar(60) NOT NULL COMMENT '抽象商品sku',
  `package_groups_id` int(11) NOT NULL DEFAULT '0' COMMENT '促销套装0、不是促销套装；大于0，促销套装ID，价格是促销套装的ID',
  `mall_groups_id` int(11) NOT NULL DEFAULT '0' COMMENT '商城套装0，不是上次套装；大于0商城套装ID',
  `gift_id` int(11) NOT NULL DEFAULT '0' COMMENT '赠品ID 0:不是赠品；大于0：是赠品，存赠品的ID',
  `is_gift` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是赠品，0、不是；1、是；',
  `money_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品单价',
  `number` int(11) NOT NULL COMMENT '商品数量',
  `money_amount` decimal(10,2) NOT NULL COMMENT '网单金额（减去立减优惠后的金额和）',
  `money_act_single` decimal(10,2) NOT NULL COMMENT '立减优惠金额和',
  `act_single_id` int(11) NOT NULL DEFAULT '0' COMMENT '单品立减活动ID，无设置0',
  `activity_id` int(11) NOT NULL DEFAULT '0' COMMENT '团购ID，为0正常购买',
  `act_flash_sale_id` int(11) NOT NULL DEFAULT '0' COMMENT '限时抢购ID，为0正常购买',
  `act_flash_sale_product_id` int(11) NOT NULL DEFAULT '0' COMMENT '限时抢购活动商品ID',
  `logistics_id` int(11) DEFAULT NULL COMMENT '物流',
  `logistics_name` varchar(100) DEFAULT NULL COMMENT '物流name',
  `logistics_number` varchar(100) DEFAULT NULL COMMENT '发票快递单号',
  `shipping_time` datetime DEFAULT NULL COMMENT '发货时间',
  `close_time` datetime DEFAULT NULL COMMENT '网单完成关闭或取消关闭时间',
  `system_remark` text COMMENT '系统备注，不给用户显示',
  `member_product_back_id` int(11) NOT NULL COMMENT '退货ID，默认为0',
  `member_product_exchange_id` int(11) NOT NULL COMMENT '换货ID，默认为0',
  `create_time` datetime NOT NULL,
  `update_time` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8 COMMENT='网单表';

-- ----------------------------
-- Records of orders_product
-- ----------------------------

-- ----------------------------
-- Table structure for order_invented
-- ----------------------------
DROP TABLE IF EXISTS `order_invented`;
CREATE TABLE `order_invented` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(50) NOT NULL COMMENT '订单号',
  `seller_id` int(11) NOT NULL COMMENT '商家ID',
  `member_id` int(11) NOT NULL COMMENT '会员ID',
  `member_name` varchar(100) NOT NULL COMMENT '会员name',
  `order_state` tinyint(3) NOT NULL COMMENT '虚拟订单状态：1、未付款的订单；2、待处理的订单；3、已完成的订单；',
  `pay_time` datetime NOT NULL COMMENT '在线付款时间',
  `payment_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '付款状态：0 买家未付款 1 买家已付款',
  `invoice_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '发票状态0、不要发票；1、单位；2个人',
  `invoice_title` varchar(255) NOT NULL COMMENT '发票抬头',
  `invioce_state` tinyint(4) NOT NULL COMMENT '发票抬头类型1、公司；2、个人',
  `invoice_type` varchar(50) NOT NULL COMMENT '发票类型',
  `money_product` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品金额，等于订单中所有的商品的单价乘以数量之和',
  `money_order` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单总金额，等于商品总金额＋运费-优惠金额',
  `money_paid_balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '余额账户支付总金额',
  `money_paid_reality` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现金支付金额',
  `money_giftcard_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '礼品卡抵用金额',
  `money_couponcode` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '优惠码优惠金额',
  `money_lower_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '下单立减金额',
  `money_back` decimal(10,2) NOT NULL COMMENT '退款的金额，订单没有退款则为0',
  `money_integral` int(11) NOT NULL COMMENT '订单消耗的积分数量',
  `lower_id` int(11) NOT NULL COMMENT '下单立减id',
  `giftcard_id` int(11) NOT NULL COMMENT '礼品卡ID',
  `couponcode_id` int(11) NOT NULL COMMENT '优惠码ID',
  `ip` varchar(50) NOT NULL COMMENT 'ip',
  `payment_name` varchar(100) NOT NULL COMMENT '支付方式名称',
  `payment_code` varchar(100) NOT NULL COMMENT '支付方式code',
  `mobile` varchar(20) NOT NULL COMMENT '接受手机号码',
  `code_exchange` varchar(255) NOT NULL COMMENT '电子兑换码',
  `is_success` tinyint(4) NOT NULL COMMENT '短信是否发生成功0、未发生；2、发生成功；2、发送失败',
  `email` varchar(50) NOT NULL,
  `zip_code` varchar(20) NOT NULL COMMENT '邮编',
  `remark` varchar(255) NOT NULL COMMENT '订单备注',
  `finish_time` datetime NOT NULL COMMENT '订单完成时间',
  `trade_sn` varchar(100) NOT NULL COMMENT '在线支付交易流水号',
  `source` varchar(100) NOT NULL COMMENT '订单来源',
  `is_gift_card_order` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否为礼品卡订单0、不是；1、是',
  `product_comments_id` int(11) NOT NULL COMMENT '评价ID，如果为0，没有评价',
  `create_time` datetime NOT NULL,
  `update_time` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='虚拟订单';

-- ----------------------------
-- Records of order_invented
-- ----------------------------

