  `product_sku` varchar(60) NOT NULL COMMENT '抽象商品sku',
  `package_groups_id` int(11) NOT NULL DEFAULT '0' COMMENT '促销套装0、不是促销套装；大于0，促销套装ID，价格是促销套装的ID',
  `mall_groups_id` int(11) NOT NULL DEFAULT '0' COMMENT '商城套装0，不是上次套装；大于0商城套装ID',
  `gift_id` int(11) NOT NULL DEFAULT '0' COMMENT '赠品ID0、没有赠品；大于0、不是赠品；大于0赠品的ID',
  `is_gift` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是赠品，0、不是；1、是；',
  `money_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品单价',
  `number` int(11) NOT NULL COMMENT '商品数量',
  `money_amount` decimal(10,2) NOT NULL COMMENT '网单金额',
  `activity_id` int(11) NOT NULL DEFAULT '0' COMMENT '团购ID，为0正常购买',
  `flashsales_id` int(11) NOT NULL DEFAULT '0' COMMENT '限时抢购ID，为0正常购买',
  `logistics_id` int(11) DEFAULT NULL COMMENT '物流',
  `logistics_name` varchar(100) DEFAULT NULL COMMENT '物流name',
  `logistics_number` varchar(100) DEFAULT NULL COMMENT '发票快递单号',
