CREATE TABLE `order_pay_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `orders_id` int(11) NOT NULL,
  `orders_sn` varchar(100) NOT NULL,
  `pay_status` varchar(50) NOT NULL COMMENT '支付方式',
  `pay_content` text NOT NULL COMMENT '支付返回的代码',
  `pay_money` decimal(10,2) NOT NULL COMMENT '支付金额',
  `member_id` int(11) NOT NULL,
  `member_name` varchar(100) NOT NULL,
  `create_time` datetime NOT NULL COMMENT '支付时间',
