-- ----------------------------
-- Records of product_type_attr
-- ----------------------------

-- ----------------------------
-- Table structure for regions
-- ----------------------------
DROP TABLE IF EXISTS `regions`;
CREATE TABLE `regions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `parentId` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '父ID，自关联',
  `regionName` varchar(120) NOT NULL DEFAULT '' COMMENT '地区名称',
  `parentPath` varchar(255) NOT NULL DEFAULT '' COMMENT '父路径',
  `firstLetter` char(1) NOT NULL DEFAULT '' COMMENT '首字母',
  `regionType` tinyint(1) NOT NULL DEFAULT '2' COMMENT '类型：1省级，2市级，3区级',
  `agencyId` smallint(5) unsigned NOT NULL DEFAULT '0',
  `shippingId` int(2) NOT NULL COMMENT '市场级别',
  `visible` tinyint(3) NOT NULL COMMENT '是否可见',
  `rowId` varchar(20) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`),
  KEY `parent_id` (`parentId`) USING BTREE,
  KEY `region_type` (`regionType`) USING BTREE,
  KEY `agency_id` (`agencyId`) USING BTREE,
  KEY `region_name` (`regionName`) USING BTREE,
  KEY `rowId` (`rowId`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1381038 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of regions
-- ----------------------------

-- ----------------------------
-- Table structure for search_keyword
-- ----------------------------
DROP TABLE IF EXISTS `search_keyword`;
CREATE TABLE `search_keyword` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `keyword` varchar(10) NOT NULL DEFAULT '' COMMENT '关键字',
  `create_time` datetime NOT NULL COMMENT '添加时间',
  `create_id` int(11) NOT NULL,
  `create_name` varchar(50) NOT NULL DEFAULT '',
  `update_time` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1065 DEFAULT CHARSET=utf8 COMMENT='搜索敏感词过滤';

