-- ----------------------------
-- Table structure for search_logs
-- ----------------------------
DROP TABLE IF EXISTS `search_logs`;
CREATE TABLE `search_logs` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `keyword` varchar(50) NOT NULL DEFAULT '' COMMENT '搜索词',
  `ip` varchar(20) NOT NULL DEFAULT '' COMMENT 'IP地址',
  `site_cookie` varchar(50) NOT NULL DEFAULT '' COMMENT 'cookie埋点',
  `member_id` int(11) NOT NULL COMMENT '用户不登录存0',
  `create_time` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='搜索历史记录表';

-- ----------------------------
-- Records of search_logs
-- ----------------------------

-- ----------------------------
-- Table structure for search_record
-- ----------------------------
DROP TABLE IF EXISTS `search_record`;
CREATE TABLE `search_record` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `keyword` varchar(50) NOT NULL DEFAULT '' COMMENT '热搜词',
  `keyword_pinyin` varchar(200) NOT NULL DEFAULT '' COMMENT '热搜词拼音',
  `keyword_index` int(11) NOT NULL COMMENT '热搜词索引数量',
  `create_id` int(11) NOT NULL,
  `create_name` varchar(50) NOT NULL DEFAULT '',
  `create_time` datetime NOT NULL,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='热搜词表';

-- ----------------------------
-- Records of search_record
-- ----------------------------

-- ----------------------------
-- Table structure for search_setting
-- ----------------------------
DROP TABLE IF EXISTS `search_setting`;
CREATE TABLE `search_setting` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `keyword` varchar(255) NOT NULL DEFAULT '' COMMENT '搜索框下关键字设置',
  `keyword_filter` tinyint(4) NOT NULL COMMENT '关键字过滤1、不过滤；2、过滤',
  `index_product_id` int(11) NOT NULL COMMENT '索引处理到最大得商品ID，0为没有处理',
  `index_product_time` datetime NOT NULL COMMENT '上次索引处理的时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='搜索设置';

