  `name` varchar(20) NOT NULL COMMENT '分类名称',
  `path` varchar(200) NOT NULL DEFAULT '' COMMENT '分类路径',
  `sort` int(11) NOT NULL COMMENT '排序',
  `create_id` int(11) NOT NULL COMMENT '创建人',
  `create_time` datetime NOT NULL COMMENT '创建时间',
