-- ----------------------------
-- Table structure for seller_complaint
-- ----------------------------
DROP TABLE IF EXISTS `seller_complaint`;
CREATE TABLE `seller_complaint` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '投诉人ID',
  `user_name` varchar(50) NOT NULL COMMENT '投诉人账户',
  `order_id` int(11) NOT NULL COMMENT '订单ID',
  `order_product_id` int(11) DEFAULT NULL COMMENT '网单ID',
  `state` tinyint(4) DEFAULT NULL COMMENT '状态：1、买家投诉待审核；2、买家投诉不通过；3、买家投诉通过；4、卖家申诉待审核；5、卖家申诉不通过；6、卖家申诉通过；',
  `product_back_id` int(11) NOT NULL COMMENT '退货管理id，如没有置为0',
  `product_exchange_id` int(11) NOT NULL COMMENT '换货管理id，如没有置为0',
  `content` text NOT NULL COMMENT '投诉内容',
  `image` varchar(255) DEFAULT NULL COMMENT '投诉图片',
  `complaint_time` datetime NOT NULL COMMENT '投诉时间',
  `seller_id` int(11) NOT NULL COMMENT '投诉商家',
  `seller_complaint_time` datetime DEFAULT NULL COMMENT '商家申诉时间',
  `seller_comp_content` text COMMENT '商家申诉内容',
  `seller_comp_image` varchar(255) DEFAULT NULL COMMENT '商家申诉图片',
  `opt_id` int(11) DEFAULT NULL COMMENT '平台处理人ID',
  `opt_content` varchar(255) DEFAULT NULL COMMENT '平台处理结果',
  `user_content` varchar(255) DEFAULT NULL COMMENT '客户反馈意见',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `opt_time` datetime DEFAULT NULL COMMENT '处理时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商家投诉管理';

-- ----------------------------
-- Records of seller_complaint
-- ----------------------------

-- ----------------------------
-- Table structure for seller_manage_cate
-- ----------------------------
DROP TABLE IF EXISTS `seller_manage_cate`;
CREATE TABLE `seller_manage_cate` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `seller` int(11) NOT NULL COMMENT '商家id',
  `create_id` int(11) NOT NULL COMMENT '申请人',
  `create_time` datetime NOT NULL COMMENT '申请时间',
  `product_cate_id` int(11) NOT NULL COMMENT '申请分类id',
  `product_cate_name` varchar(255) NOT NULL COMMENT '申请分类名称,提交类目组合',
