INSERT INTO `system_admin` VALUES ('6', null, '天天开心', '96e79218965eb72c92a549dd5a330112', null, null, '50', '1.00', '96e79218965eb72c92a549dd5a330112', '商家管理员', '2', 'seller', '真开心', 'https://oss.ywq157.com/app/1559740594193.jpg', '', '13825445562', null, '1', '0', null, '2019-06-05 21:16:00', null);
INSERT INTO `system_admin` VALUES ('8', null, 'test', 'e10adc3949ba59abbe56e057f20f883e', null, null, '100', '100.00', 'e10adc3949ba59abbe56e057f20f883e', '贷超管理员', '3', 'loanManager', '口香糖', 'https://oss.ywq157.com/app/1560005568062.png', '<p><img class=\"wscnph\" src=\"https://oss.ywq157.com/app/1560005586310.jpg\" /></p>\n<p>&nbsp;</p>\n<p>　<a href=\"http://www.duwenzhang.com/wenzhang/shenghuosuibi/\">生活</a>，没有什么大道理可言，过日子，就是一种<a href=\"http://www.duwenzhang.com/wenzhang/xinqingriji/\">心情</a>， 用好的心情去生活，累也不说累，苦也不言苦。&nbsp;<a href=\"http://www.duwenzhang.com/huati/xingfu/index1.html\">幸福</a>，或许正是体现在这&ldquo;不说累&rdquo;和&ldquo;不言苦&rdquo;当中&hellip;&hellip;</p>\n<p><a href=\"http://www.duwenzhang.com/wenzhang/renshengzheli/ganwu/20130618/258957.html\"><img src=\"http://www.duwenzhang.com/upimg/130618/1_064514.jpg\" alt=\"生活，就是过的一种心情\" width=\"243\" height=\"173\" align=\"right\" border=\"0\" /></a>　　我也常常会累，也常常会心情浮燥，常常在一些早已<a href=\"http://www.duwenzhang.com/huati/huiyi/index1.html\">老去的回忆</a>里念念不忘；常常因为将心情投入了哪段文、或者是哪首歌而引发了些感慨；也很容易陷入别人的情绪或<a href=\"http://www.duwenzhang.com/\">别人的故事</a>；所以，也总是絮絮着些<a href=\"http://www.duwenzhang.com/huati/youshang/index1.html\">忧伤</a>。</p>\n<p>　　实际生活，却是在甩甩打打中过得简单而痛快，并没让哪种琐事牵拌着情绪过日子，也不让太多杂七杂八的事乱了心绪，所以，生活有时候尽管会忙碌些繁琐些，心却并不累。</p>\n<p>　　过日子，真的就是个心情， 歌里唱的，剧中演的，或许会有那么点滴的情绪影射，却不是完全属于自己的，感慨过之后，就好好过自己的日子， 无非就是一家老小，无非就是<a href=\"http://www.duwenzhang.com/huati/jiating/index1.html\">家庭</a>工作，而一切的一切，最终无非都落在了&ldquo;心情&rdquo;二字之上。</p>\n<p>　　生活，不是件简单的事， 没有太多的一帆风顺，也没有太多的心想事成，有的，只是些随时可能的&ldquo;碰壁&rdquo;&hellip;&hellip;</p>\n<p>　　或许，倾心已久的人就在你举目可见的地方，却不一定是在等你；</p>\n<p>　　或许，<a href=\"http://www.duwenzhang.com/huati/nuli/index1.html\">付出努力</a>和艰苦后，你的钞票并不会乖乖地躲进你的腰包里；</p>\n<p>　　或许，积年累月地寻找着突破<a href=\"http://www.duwenzhang.com/huati/shiye/index1.html\">事业</a>的窗口，<a href=\"http://www.duwenzhang.com/huati/xianshi/index1.html\">现实</a>却并不成全你；</p>\n<p>　　或许，你的肉体会遭遇些病痛；</p>\n<p>　　或许，你的亲人在经历些变故；</p>\n<p>　　或许，你的明天依旧遥远；</p>\n<p>　　或许，&hellip;&hellip;</p>\n<p>　　因这种种或许， 难免有人会彷徨，难免有人会失意，会怨天尤人， 可是，有点情绪不要紧，当走入一种消极的情绪后，要极时地走出来，努力调整自己， 不要让坏的情绪长久地占据<a href=\"http://www.duwenzhang.com/huati/xinling/index1.html\">你的心灵</a>，影响你本可以<a href=\"http://www.duwenzhang.com/huati/kaixin/index1.html\">开心</a>和幸福的生活。</p>\n<p>　　过日子，<a href=\"http://www.duwenzhang.com/huati/xintai/index1.html\">调整心态</a>，保持好心情是很重要的。 不管什么样的困难，不管什么样的<a href=\"http://www.duwenzhang.com/huati/cuozhe/index1.html\">挫折</a>，总会有雨过天晴的时候，忧伤和埋怨解决不了任何问题，唯有积极面对。</p>\n<p>　　正如很多人所说的，<a href=\"http://www.duwenzhang.com/wenzhang/renshengzheli/\">笑对人生</a>，这，就是一种积极的生活<a href=\"http://www.duwenzhang.com/huati/taidu/index1.html\">态度</a>， 当我们努力地克服了自身的狭隘自私，当我们努力地学习了<a href=\"http://www.duwenzhang.com/huati/ganen/index1.html\">感恩</a>和<a href=\"http://www.duwenzhang.com/huati/zhizu/index1.html\">知足</a>，当我们努力地懂得了<a href=\"http://www.duwenzhang.com/huati/kuanrong/index1.html\">宽容</a>与<a href=\"http://www.duwenzhang.com/huati/weixiao/index1.html\">微笑</a>，</p>\n<p>　　那么，简单而开心的生活便离我们不会遥远。</p>\n<p>　　感恩，知足，微笑，简单，这样方能赢得开心大世界。</p>\n<p>　　心情的颜色是活泼热烈的红色，是生机盎然的绿色，是尊贵华丽的黄色， 好好地，用这种种颜色做心情，来书写生活，不要让它变得灰暗&hellip;&hellip;</p>\n<p>　　累也不说累，苦也不言苦； 祝：好心情；祝：幸福！</p>\n<p>&nbsp;</p>', '13824556654', null, '1', '0', null, '2019-06-08 22:52:51', '2019-06-08 23:28:06');
